import { Link } from "react-router-dom"

export const Ectenias = ({ list }) => {
  return (
    <>
      <ul className="library">
        {list.map((item) => {
          console.log(item);
          <li key={item.path} className="library__element">
            <Link to={item.path} className="itemLink">
              {item.path}
            </Link>
          </li>
      })}
      </ul>
    </>
  )
}
